          <th scope="col">Año de formación</th>
          <th scope="col">Número de álbumes</th>
          <th scope="col">Canción más conocida</th>
        </tr>
      </thead>

      {empleados.map((empleado) => (
        <div className="table">
          <tbody>
            <tr>
              <th scope="row" className="thead th:nth-child(1)">{empleado.name}</th>
              <td>{empleado.age}</td>
              <td>{empleado.sector}</td>
              <td>{empleado.email}</td>
            </tr>
          </tbody>
        </div>
      ))}
    </div>

